window.bookSummaryJSON = "<p><b>A rogue Overmind is on the loose.</b></p> <p>A million souls hang in the balance.</p> <p>The Solaran Defense Forces make the difficult decision to evacuate the colony of Robichar in order to avoid a direct confrontation. But when Captain Elya Nevers gets shot down during the evacuation, his squadron and the admiral in charge have to think fast to rescue their pilot before the Kryl overrun the system.</p> <p>Fighting to survive in hostile territory, Captain Nevers discovers what the rampaging Overmind is really after - and it changes everything.</p> <p>An extinct species known as the Telos fled the galaxy eons ago. What caused them to vanish in such a hurry? And more importantly, what ancient relics of alien power did they leave behind?</p> <p>Itâ€™s fly or die in this space opera action adventure for fans of <i>Battlestar Galactica</i>, <i>Star Wars</i>, <i>Honor Harrington</i>, and <i>Starcraft II.</i></p>"; 
